import React, { useContext } from 'react';
import Equipo from './Equipo';
import EquipoContext from '../../context/proyectos/EquipoContext'

const ListadoEquipos = () => {

    const EquiposContext = useContext(EquipoContext);
    const {equipos} = EquiposContext;
    
    //revisar si equipos tiene contenido
    console.log('largo: ' + equipos.lenght);
    if(equipos.lenght === 0) return null;
    
    return (
        <ul className="Listado-proyectos">
            {equipos.map(equipo => (
                <Equipo
                    equipo={equipo}
                />
            ))}
        </ul>
    );
}
export default ListadoEquipos;
